export function SubmitButton() {
    function handleSubmit(e) {
        e.preventDefault();
        return(
            <h1>
                BUTTON CLICKED !
            </h1>
        );

    }

    return (
        <form onSubmit={handleSubmit}>
            <button type="submit">Submit</button>
        </form>
    );
}
